import React from 'react';
import Title from './components/Title';
import Box from './components/Box';
import Button from './components/Button';

function App() {

  return (
    <div className='font color-body'>
      <div className='container'>

        <Title />
        <Box />
        <Button />

      </div>
    </div>
  );
}

export default App;
